import React from 'react';
import { useCart } from 'react-use-cart';
import { jsPDF } from 'jspdf';
import './cart.css'

const Cart = () => {
  const {
    isEmpty,
    totalUniqueItems,
    items,
    totalItems,
    cartTotal,
    updateItemQuantity,
    removeItem,
    emptyCart,
  } = useCart();

  const generatePDF = () => {
    const doc = new jsPDF();

    const headerImg  = 'data:image/png;base64,'

    const addHeaderImage = () => {
      const pages = doc.internal.getNumberOfPages();
      for (let i = 1; i <= pages; i++) {
        doc.setPage(i);
        // Make sure to adjust the dimensions as needed for your specific image
        doc.addImage(headerImg, 'PNG', 10, 10, doc.internal.pageSize.getWidth() - 20, 30);
      }
    };

    addHeaderImage();

    
    // Set up formatting
    const margin = 10;
    const lineHeight = 10;
    const maxWidth = doc.internal.pageSize.getWidth() - 2 * margin;

    // Add header
    doc.setFontSize(18);
    doc.text('Receipt', margin, margin);

    // Add date
    const date = new Date();
    const dateString = `${date.getDate()}/${date.getMonth() + 1}/${date.getFullYear()} ${date.getHours()}:${date.getMinutes()}`;
    doc.setFontSize(12);
    doc.text(`Date: ${dateString}`, margin, margin + lineHeight);

    // Add items
    doc.setFontSize(12);
    let yPosition = margin + 3 * lineHeight;
    items.forEach((item, index) => {
      const { title, price, size, quantity } = item;
      const itemText = `${title} - Rs. ${price} x ${quantity} (${size})`;
      const lines = doc.splitTextToSize(itemText, maxWidth);
      doc.text(lines, margin, yPosition);
      yPosition += (lines.length + 0.5) * lineHeight;
    });

    // Add total
    doc.setFontSize(14);
    const totalText = `Total: Rs. ${cartTotal}`;
    doc.text(totalText, margin, yPosition + lineHeight);

    // Save the PDF
    doc.save('receipt.pdf');

    // Optionally clear the cart after purchase
    emptyCart();
  };

  if (isEmpty) return <h1 className="cart-empty">Your Cart is Empty</h1>;

  return (
    <section className="cart-container">
      <div className="cart-header">
        <h5>Cart ({totalUniqueItems}) Total Items: ({totalItems})</h5>
      </div>
      <div className="cart-items">
        {items.map((item, index) => (
          <div className="cart-item" key={index}>
            <div className="item-image">
              <img src={item.img} alt={item.title} />
            </div>
            <div className="item-details">
              <h6>{item.title} ({item.size})</h6>
              <p className="item-price">Rs. {item.price}</p>
              <div className="quantity-controls">
                <button
                  className="quantity-decrease"
                  onClick={() => updateItemQuantity(item.id, item.quantity - 1)}
                  disabled={item.quantity === 1}
                >
                  -
                </button>
                <span>Quantity: {item.quantity}</span>
                <button
                  className="quantity-increase"
                  onClick={() => updateItemQuantity(item.id, item.quantity + 1)}
                >
                  +
                </button>
              </div>
              <button className="remove-item" onClick={() => removeItem(item.id)}>
                Remove Item
              </button>
            </div>
          </div>
        ))}
      </div>
      <div className="cart-footer">
        <h2>Total Price: Rs. {cartTotal}</h2>
        <div className="cart-actions">
          <button className="clear-cart" onClick={() => emptyCart()}>
            Clear Cart
          </button>
          <button className="buy-now" onClick={generatePDF}>
            Buy Now
          </button>
        </div>
      </div>
    </section>
  );
  
  
};

export default Cart;
